import { Layout } from "../components/Layout";

const BlogLink = ({ title, children }) => (
  <li>
    <Link href={`/blog/${title}`}>
      <a>{children}</a>
    </Link>
  </li>
);

function Blog() {
  return (
    <Layout>
      <h2>This is the blog page</h2>
      <ul>
        <BlogLink title="blog1">First Blog</BlogLink>
        <BlogLink title="blog2">Second Blog</BlogLink>
        <BlogLink title="blog3">Third Blog</BlogLink>
      </ul>
    </Layout>
  );
}

export default Blog;
